          <img
            className="event-photo"
            src={devUrl + '/pic/pic/桌布-德國.jpg'}
            alt=""
          ></img>
        </figure>
        <figure className="box">
          <img
            className="event-photo"
            src={devUrl + '/pic/pic/桌布-德國.jpg'}
            alt=""
          ></img>
        </figure>
      </Carousel>
    )
  }
}

export default MemberAlbumPhotoCarousel
